import React from 'react'
import Gauge from './Gauge.js'

function GaugeHolder() {
    const difficulty = .45;
    const altitude = 5919;
    const length = 2415;

    return (
        <div class="gauges">
            <Gauge value={"Difficulty"} id={"gauge-chart1"} percent={difficulty}/>
            <Gauge value={"Altitude"} id={"gauge-chart2"} percent={0.50}/>
            <Gauge value={"Length"} id={"gauge-chart3"} percent={.2}/>
        </div>
    )
} 

export default GaugeHolder
